import React, {useState, useEffect, Component} from "react";
import axios from "axios";
axios.defaults.baseURL = "http://localhost:3001"

class DisplayDict extends Component{
    render(){
        const {dict, branching_factor, num_entries} = this.props;
        return (
            <div className = "dict_stat_display" class = "flex flex-col">
                <div className = "gen-dict-label" class = "text">Your dictionary has been generated.</div>
                <div className = "stat_display" class = "text">Branching Factor: {props.branching_factor} Number of Entries: {props.num_entries}</div>
                <div className = "dict_display" class = "w-6/12 h-6/12">
                    {props.dict}
                </div>

            </div>
        )
}
}
